import React,{useContext} from 'react'
import { RoomContext } from '../context'
import {Link} from "react-router-dom"
import LoginNavBar from '../logincomponents/LoginNavBar'
import { withRoomConsumer } from "../context";
import {FcHome} from "react-icons/fc"



const BookedProperties = ({context}) => {


        // const context = useContext(RoomContext)

        const {rooms} = context;
        // console.log(context);
        const{
            handleChange,
            type,
            capacity,
            price,
            minPrice,
            maxPrice,
            place,
            // breakfast,
            // pets
        } = context
    
        console.log(context);
    
        
    return (
        <div>
            <LoginNavBar/>
            <br/>
            <br/>
            <br/>            
            <h1>Your Booked Properties:<FcHome size={40}/></h1>
            <Link to='/Login' className="btn-primary">Login</Link>
        </div>


    )
}

export default withRoomConsumer(BookedProperties)

// export default BookedProperties;
